INSERT INTO `about` (`packageId`, `title`, `description`) VALUES
(1, 'STUDENT PACKAGE', '\r\nUnder the student package we have the daily plan,weekly plan,monthly plan and semester plan.This is a tremendous way of saving cost for students who prefer to eat out or those who naturally dont cook during exams All you have to do is register for your plan, create a time table , the location where the food will be delivered and time will be stated and vola you have the meal of your choice brought to you daily.'),
(2, 'CORPORATE PACKAGE', '\r\nAll workers should rejoice, you can now have the meal you desire without having to leave a pile of work load behind .We bring the meal right to your office helping you never miss a meal and avoiding all form of ailment that arises from hunger strike.'),
(3, 'GIFT CARD', '\r\nRefer to your friends and get a gift card to purchase your meals,all you need to do is share your referral links, ensure they register with it and when you have two active friends on these platforms you earn a gift card for a free standard meal'),
(4, 'FOLLOW THE FLOW', '\r\nEat according to your mood, you can be on a weekly, monthly or semester plan without having a meal timetable. If you are someone who loves to eat as the craving sets in then this package is for you,you order daily stating whatever you feel like eating and we would get it to you in just a minute.'),
(5, 'MEAL TIMETABLE (ENJOY EATING)', '\r\nWe provide a time table which helps in various ways:\r\n\r\n1.Helps you keep to your diet,by filling the time table with your diet plan weekly,we deliver the meal recorded on your meal timetable to you daily and in situations where you forgot to update your weekly timetable, a reminder will be sent to you to renew time table or use previous week timetable\r\n\r\n2. If you have a busy schedule this might be for you,In your busy schedule we help deliver your recorded meal on your meal time table daily helping you focus on your work and not having to miss a meal\r\n\r\nWEEKLY PLAN\r\nUnder the weekly plan we have the Follow the flow package and the Meal timetable package.\r\n\r\nIn this plan you pay for a week meal depending on the daily limit rate you decide to fix, we have a minimum of 3500 to 7500. This plan operates on Monday to Friday for those under the corporate plan,any other order made on a weekend or else you request for the expense to be deducted from your plan and for those under the student package it runs for seven days of the week\r\n\r\nMONTHLY PLAN\r\nIn this plan you pay for a month meal depending on the daily limit rate you decide to fix, we have a minimum of 13000 to 29000. This plan operates on Monday to Friday for those under the corporate plan,any other order made on a weekend or else you request for the expense to be deducted from your plan and for those under the student package it runs for seven days of the week.In this plan we also have the Meal timetable package and the Follow the flow package\r\n\r\n'),
(6, 'WEEKLY PLAN', '\r\nUnder the weekly plan we have the Follow the flow package and the Meal timetable package.\r\n\r\nIn this plan you pay for a week meal depending on the daily limit rate you decide to fix, we have a minimum of 3500 to 7500. This plan operates on Monday to Friday for those under the corporate plan,any other order made on a weekend or else you request for the expense to be deducted from your plan and for those under the student package it runs for seven days of the week'),
(7, 'MONTHLY PLAN', '\r\nIn this plan you pay for a month meal depending on the daily limit rate you decide to fix, we have a minimum of 13000 to 29000. This plan operates on Monday to Friday for those under the corporate plan,any other order made on a weekend or else you request for the expense to be deducted from your plan and for those under the student package it runs for seven days of the week.In this plan we also have the Meal timetable package and the Follow the flow package'),
(8, 'SEMESTER PLAN', '\r\nAs a student you can register for the semester plan helping us help you through out your semester,as the money land your hand bam,you pay to, this help you remove the story of \"hunger dey o money done finish\",gone are the days when student live to suffer, when you have to return home dry as a bone,now you can look healthy and still have the best grades. This plan operates through out the week, we have the Meal timetable package and the Follow the flow package under this plan and trust me its really exciting');

